import React from 'react';

function Footer() {
  return (
    <footer style={{
      backgroundColor: '#B22222',
      color: 'white',
      textAlign: 'center',
      padding: '15px',
      marginTop: '30px'
    }}>
      <p>&copy; 2025 Bharakath Mutton Curry Shop. All Rights Reserved.</p>
      <p>Shop Location: <a href="https://maps.google.com/?q=Bharakath+Mutton+Curry+Shop" target="_blank" rel="noopener noreferrer" style={{color: 'white', textDecoration: 'underline'}}>View on Google Maps</a></p>
      <p>Address: Vadaseri Main Road, Near Bus Stand, Ullikottai, Tamil Nadu 614018</p>
    </footer>
  );
}

export default Footer;
